const parseData = (data) => {
  if (!data || !data.length) return;
  let stack = [];
  for (let i = 0, len = data.length; i < len; i++) {
    stack.push(data[i]);
  }
  let item;
  while (stack.length) {
    item = stack.shift();
    if (item.children && item.children.length) {
      stack = stack.concat(item.children);
    }
  }
};
parseData(data);
